description_bien:
Hosman vous propose cette spacieuse maison de 120 m² habitables, située sur la Rue Pierre Mendès France à Bassens. Bâtie en 1998, elle offre un cadre de vie agréable avec un grand jardin de 490 m² sur une parcelle totale de 609 m². Terrasse spacieuse et emplacement piscinable.

Planifiez facilement votre visite en choisissant le créneau qui vous convient depuis le site d'hosman.

La maison se compose comme suit :
Un grand séjour lumineux de 54 m² avec cheminée fonctionnelle, spacieux et traversant avec accès direct à la terrasse ;
Quatre chambres équipées de dressings intégrés, parfaite pour accueillir une famille ;
Une suite parentale avec douche, toilettes, installation pour machine à laver et dressing ;
Une cuisine semi-ouverte, pratique et conviviale ;
Une salle de bain avec double vasque et baignoire ;
Des toilettes séparées.

Équipements extérieurs : Deux places de stationnement et une possibilité de garage supplémentaire.

Le système de chauffage et l'eau chaude sont électriques.
La taxe foncière annuelle est de 1 200 €.

La maison est idéalement située dans un quartier de Bassens attrayant et dynamique :
Écoles et établissements pour les jeunes à proximité ;
Proximité des commerces, facilitant le quotidien ;
Excellent service de transport en commun avec des bus reliant rapidement le cœur de Bordeaux.

Hosman s'efforce de réinventer l'agence immobilière en offrant un service innovant et transparent aux acheteurs et aux vendeurs. Nos frais d'agence sont de 8 900 euros fixes à la charge du vendeur.

Si vous êtes un professionnel de l'immobilier (agent, mandataire ou chasseur immobilier), sachez que toutes les annonces Hosman sont ouvertes à la collaboration. N'hésitez pas à nous contacter pour en discuter.

Entre Aspremont et Tourrette Levens, sur un magnifique terrain arboré, avec belle piscine et oliveraie, charmante villa de 250m² au sol et 162m² habitables, composée au rez de jardin d'un séjour, une salle à manger, une cuisine équipée, 3 chambres, une salle de bains, une toilette, une buanderie;
Au premier étage, récemment rénové, avec velux automatisés, 3 chambres, une salle de douche wc, 2 coins bureaux;
Au sous sol 113m² avec locaux techniques et grand garage.
Cette villa bénéficie également d'un forage pour l'arrosage du jardin et la piscine, et d'un système de panneaux photovoltaïques.
A VOIR ABSOLUMENT.
